  public static int valueOf3Bytes(byte[] val, int offset) {
    if (val[offset] < 0) {
      return (((val[offset] & 0xffff) << 16) |
              ((val[offset + 1] & 0xff) << 8) |
              ((val[offset + 2] & 0xff)));
    } else {
      return (((val[offset] & 0xff) << 16) |
              ((val[offset + 1] & 0xff) << 8) |
              ((val[offset + 2] & 0xff)));
    }
  }
